remarks.format:
  
  
## Remarks  
 Eine- <xref:System.Runtime.Caching.CacheItemPolicy> Instanz enthält Informationen, die einem Cache Eintrag zugeordnet werden können. Wenn z. b. ein Cache Eintrag aus dem Cache entfernt werden soll, wird ein- <xref:System.Runtime.Caching.CacheEntryUpdateArguments> Objekt an eine Rückruf Methode übermittelt. Die- <xref:System.Runtime.Caching.CacheEntryUpdateArguments.UpdatedCacheItemPolicy%2A> Eigenschaft des- <xref:System.Runtime.Caching.CacheEntryUpdateArguments> Objekts kann einen Verweis auf eine <xref:System.Runtime.Caching.CacheItemPolicy> -Instanz übergeben, die Entfernungs-und Ablauf Details zum Cache Eintrag enthalten kann.  
  
 Einige Methoden in den <xref:System.Runtime.Caching.MemoryCache> -und- <xref:System.Runtime.Caching.ObjectCache> Klassen akzeptieren eine- <xref:System.Runtime.Caching.CacheItemPolicy> Instanz, um die Entfernungs-oder Ablauf Richtlinie zu beschreiben  
  
   
  
## Examples  
 Im folgenden Beispiel wird gezeigt, wie ein in-Memory-Cache Element erstellt wird, das den Pfad für eine Textdatei überwacht. Der Cache erstellt ein <xref:System.Runtime.Caching.CacheItemPolicy> -Objekt und legt die- <xref:System.Runtime.Caching.CacheItemPolicy.AbsoluteExpiration%2A> Eigenschaft fest, um den Cache nach 60 Sekunden zu entfernen.  
  
```vb  
Protected Sub Button1_Click(ByVal sender As Object, _  
            ByVal e As System.EventArgs) Handles Button1.Click  
    Dim cache As ObjectCache = MemoryCache.Default  
    Dim fileContents As String = TryCast(cache("filecontents"), _  
            String)  
    If fileContents Is Nothing Then  
        Dim policy As New CacheItemPolicy()  
        policy.AbsoluteExpiration = _  
            DateTimeOffset.Now.AddSeconds(60.0)  
        Dim filePaths As New List(Of String)()  
     Dim cachedFilePath As String = Server.MapPath("~") & _  
         "\cacheText.txt"  
        filePaths.Add(cachedFilePath)  
        policy.ChangeMonitors.Add(New _  
            HostFileChangeMonitor(filePaths))  
  
        ' Fetch the file contents.  
        fileContents = File.ReadAllText(cachedFilePath)  
        cache.Set("filecontents", fileContents, policy)  
    End If  
    Label1.Text = fileContents  
End Sub  
```  
  
```csharp  
protected void Button1_Click(object sender, EventArgs e)  
    {  
        ObjectCache cache = MemoryCache.Default;  
            string fileContents = cache["filecontents"] as string;  
            if (fileContents == null)  
            {  
                CacheItemPolicy policy = new CacheItemPolicy();  
                policy.AbsoluteExpiration =   
                    DateTimeOffset.Now.AddSeconds(60.0);  
  
                List<string> filePaths = new List<string>();  
             string cachedFilePath = Server.MapPath("~") +   
                 "\\cacheText.txt";  
             filePaths.Add(cachedFilePath);  
  
                policy.ChangeMonitors.Add(new   
                    HostFileChangeMonitor(filePaths));  
  
                // Fetch the file contents.  
                fileContents = File.ReadAllText(cachedFilePath);  
  
                cache.Set("filecontents", fileContents, policy);  
  
            }  
  
            Label1.Text = fileContents;  
        }  
```
